import React from "react";
import {Container, Navbar, Nav, Row, Col } from "react-bootstrap";
import "./Footer.css";

const Section = (props) => {
  return (
    <Col>
      <h1>{props.tag}</h1>
      <a href="#fd">{props.link}</a>
    </Col>  
  )
};


const Footer = () => {
    return (
      <div className="Footer">
        <div style={{background: "black", paddingTop: "100pt", paddingBottom: "100pt"}}>
          <Container>
            <Row>
              <Section tag="Links" text="lorem ipsum dolor sit amet, uno dos tres quotro" />
              <Section tag="Link 2" text="lorem ipsum dolor sit amet, uno dos tres quotro" />
              <Section tag="Link 3" text="lorem ipsum dolor sit amet, uno dos tres quotro" />
              <Section tag="Link 4" text="lorem ipsum dolor sit amet, uno dos tres quotro" />
            </Row>
          </Container>
        </div>

        <Navbar expand="md" variant="dark" className="nav">
          <Container>
            <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
              <Nav
                className="ml-2 my-2 my-lg-0"
                style={{ maxHeight: '100px' }}
                navbarScroll
              >
              <Nav.Link href="#action1">Products</Nav.Link>
              <Nav.Link href="#action1">Features</Nav.Link>
              <Nav.Link href="#action1">Contact</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
      </div>
     );
}

export default Footer;
